.
If you've been looking at my stories, you'll notice that these two weeks have been pretty busy. Five shoots in two weeks, and the last three were all a day after eachother!
.
So what have I learnt from this?
The shoots got easier as they progressed
My confidence has improved (at least in front of the camera)
I'm more insecure about my body
But, I have tried to be more experimental in my poses to hide this
.
Most of all, I have realised how much I detest wearing makeup! 😂 It's not actually good for my skin because I am very acne prone with dry skin! Yum yes! 🤦‍♀️
.
I'm glad that I am learning new skills and making improvements on my mentality
.
Can't wait to show you all the pictures from these shoots!
.
